import React from 'react';
import './App.css';

function Nav() {
    return(
        <nav>
           <h3>Logo</h3>
           <ul>
                <li>Main Page</li>
                <li>Admin Page</li>
            </ul> 
        </nav>
    );
}

export default Nav;
